/**
 * Return the full runtime settings with sensitive keys redacted.
 */
export function getFullSettings(): Record<string, unknown> {
  const cfg = convictConfig();
  cfg.validate({ allowed: "warn" });

  const raw = cfg.getProperties();

  function redact(obj: any): any {
    if (typeof obj !== "object" || obj === null) return obj;
    return Object.fromEntries(
